from collections import deque

class Solution:
    def dailyTemperatures(self, temperatures: [int]) -> [int]:
        # 每次入栈之后找小于当前数pop
        t_len = len(temperatures)
        res = [-1]*t_len
        stack = deque([])
        for i, tp in enumerate(temperatures):
            j,need_del=0,[]
            while j < len(stack):
                tmp = stack[j]
                if tmp[0] < tp:
                    res[tmp[1]] = i-tmp[1]
                    need_del.append(stack[j])
                j += 1
            for k in need_del:
                stack.remove(k)
            stack.append((tp, i))

        while stack:
            num, id = stack.pop()
            res[id] = 0

        return res

    def dailyTemperatures2(self, temperatures: [int]) -> [int]:
        t_len = len(temperatures)
        max_id = 0
        res = [-1]*t_len
        stack = deque([])
        for i in range(len(temperatures)):
            tp = temperatures[i]
            max_id = i if tp > temperatures[max_id] else max_id
            if stack and tp > stack[len(stack)-1]:
                res[i-1] = 1
                stack.pop()
            stack.append(tp)
        print(res)
        tmp = 1
        for j in range(t_len-1,0,-1):
            if j >= max_id and res[j] == -1:
                res[j] = 0
            if j < max_id:
                if res[j] == -1: res[j] = tmp
                tmp += res[j]

        return res


